import React from 'react';
import './Dashboard.css';
import Side from './sidebar';

function Dashboard(){
return(
    <div className="dsh">
      <div className='dashboard'>
          <div>
              <Side/>
          </div>
          <div className="content">
              Hello
          </div>
      </div>
    </div>
)
}
export default Dashboard;
